pragma solidity ^0.6.12;

contract YourContract {
    address public owner;
    uint256 public maximuminvestmentsallowed;
    uint256 public waittimeuntilwithdrawortransfer;
    uint256 public bankroll;
    mapping(address => uint256) public trustedaddresses;
    address public dice;
    address public slots;
    mapping(address => uint256) public checkwhencontributorcantransferorwithdraw;
    uint256 public totalsupply;
    mapping(address => uint256) public balanceof;
    mapping(address => mapping(address => uint256)) public allowance;

    constructor() public {
        owner = msg.sender;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function withdrawDevelopersFund(address payable _to) public {
        require(msg.sender == owner, "Only owner can call this function.");
        (bool success, bytes memory data) = dice.call(abi.encodeWithSignature("payDevelopersFund(address)", _to));
        require(success, "External call to dice contract failed.");
        (success, data) = slots.call(abi.encodeWithSignature("payDevelopersFund(address)", _to));
        require(success, "External call to slots contract failed.");
        _to.transfer(bankroll);
        bankroll = 0;
    }

    function payOraclize(uint256 _value) public {
        require(trustedaddresses[msg.sender] != 0, "Not a trusted address.");
        (bool success, bytes memory data) = msg.sender.call{value: _value}(abi.encodeWithSignature("receivePaymentForOraclize()"));
        require(success, "External call to receivePaymentForOraclize failed.");
    }

    function changeMaximumInvestmentsAllowed(uint256 _value) public {
        require(msg.sender == owner, "Only owner can call this function.");
        maximuminvestmentsallowed = _value;
    }

    function payEtherToWinner(uint256 _value, address payable _to) public {
        require(trustedaddresses[msg.sender] != 0, "Not a trusted address.");
        (bool success,) = _to.call{value: _value}("");
        if (!success) {
            owner.call{value: _value}("");
        }
    }

    function changeWaitTimeUntilWithdrawOrTransfer(uint256 _value) public {
        require(_value <= 0x5c4900 && msg.sender == owner, "Invalid value or unauthorized access.");
        waittimeuntilwithdrawortransfer = _value;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(allowance[_from][msg.sender] >= _value && _to != address(0) && 
                block.timestamp >= waittimeuntilwithdrawortransfer + checkwhencontributorcantransferorwithdraw[_from] && 
                balanceof[_from] >= _value && _to != address(this), "Transfer not possible.");
        balanceof[_to] += _value;
        balanceof[_from] -= _value;
        allowance[_from][msg.sender] -= _value;
        return true;
    }

    function transferOwnership(address newOwner) public {
        require(msg.sender == owner, "Only owner can transfer ownership.");
        owner = newOwner;
    }

    function ERC20Rescue(address _token, uint256 _value) public {
        require(msg.sender == owner, "Only owner can call this function.");
        (bool success, bytes memory data) = _token.call(abi.encodeWithSignature("transfer(address,uint256)", msg.sender, _value));
        require(success, "ERC20 Rescue failed.");
    }

    receive() external payable {
        require(msg.value > 0 && balanceof[address(this)] - bankroll - msg.value < maximuminvestmentsallowed, 
                "Invalid investment.");
        checkwhencontributorcantransferorwithdraw[msg.sender] = block.timestamp;
        if (totalsupply == 0) {
            totalsupply += 100 * msg.value;
            balanceof[msg.sender] += 100 * msg.value;
        } else {
            uint256 tokens = (totalsupply * msg.value) / (balanceof[address(this)] - bankroll - msg.value);
            balanceof[msg.sender] += tokens;
            totalsupply += tokens;
        }
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(block.timestamp >= waittimeuntilwithdrawortransfer + checkwhencontributorcantransferorwithdraw[msg.sender] && 
                balanceof[msg.sender] >= _value && _to != address(this) && _to != address(0), "Transfer not possible.");
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
        return true;
    }

    function cashoutEOSBetStakeTokens_ALL() public {
        require(block.timestamp >= waittimeuntilwithdrawortransfer + checkwhencontributorcantransferorwithdraw[msg.sender] &&
                balanceof[msg.sender] > 0, "Cashout not possible.");
        totalsupply -= balanceof[msg.sender];
        balanceof[msg.sender] = 0;
    }

    function cashoutEOSBetStakeTokens(uint256 _value) public {
        require(block.timestamp >= waittimeuntilwithdrawortransfer + checkwhencontributorcantransferorwithdraw[msg.sender] &&
                _value <= balanceof[msg.sender] && _value > 0, "Cashout not possible.");
        totalsupply -= _value;
        balanceof[msg.sender] -= _value;
    }
}
